import { MDBBtn, MDBCol, MDBContainer, MDBRow } from "mdbreact";

class Addeditem extends Component {
    render() {
      return (
        <div>
                <form>
                    <input type="text" placeholder="enter your plane" id="todoname" onChange={this.handelchange} />
                    <input type="time" placeholder="enter your time" id="todoname" onChange={this.handelchange} />

                </form>

            </div>
      );
    }
  }
  
  export default Addeditem;
